import React from "react";
import ReactDOM from "react-dom";
import "antd/dist/antd.css";
import "./index.css";
import { Table, Tag, Space } from "antd";

const data = [
  {
    key: "1",
    device_ip_addr: "192.168.1.100",
    mac_addr: "255.255.255.0",
    hostname: "PC-1001",
    device_type: "Workstation",
  },
  {
    key: "2",
    device_ip_addr: "192.168.1.100",
    mac_addr: "255.255.255.0",
    hostname: "PC-1001",
    device_type: ["nice", "developer"],
  },
  {
    key: "3",
    device_ip_addr: "192.168.1.100",
    mac_addr: "255.255.255.0",
    hostname: "PC-1001",
    device_type: ["nice", "developer"],
  },
];

const columns = [
  {
    title: "IP Address",
    dataIndex: "device_ip_addr",
    key: "device_ip_addr",
  },
  {
    title: "Mac Address",
    dataIndex: "mac_addr",
    key: "mac_addr",
  },
  {
    title: "Hostname",
    dataIndex: "hostname",
    key: "hostname",
  },
  {
    title: "Tags",
    key: "tags",
    dataIndex: "tags",
    render: (tags) => (
      <>
        {tags.map((tag) => {
          let color = tag.length > 5 ? "geekblue" : "green";
          if (tag === "loser") {
            color = "volcano";
          }
          return (
            <Tag color={color} key={tag}>
              {tag.toUpperCase()}
            </Tag>
          );
        })}
      </>
    ),
  },
  {
    title: "Action",
    key: "action",
    render: (text, record) => (
      <Space size="middle">
        <a>Invite {record.name}</a>
        <a>Delete</a>
      </Space>
    ),
  },
];

function Help() {
  return (
    <div>
      <Table columns={columns} dataSource={data} />
    </div>
  );
}

export default Help;
